  Reef Assessment and Monitoring Program (CRAMP): benthic data from digital still
  images made in 2008-2010 on Kauai, Oahu, Molokai, Maui, and Hawaii (NODC Accession
  0104255)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
