  \"hawaii-coral-reef-assessment-and-monitoring-program-cramp-benthic-data-from-digital-still-image45c0b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset consists of benthic data from
  the Hawaii Coral Reef Assessment and Monitoring Program (CRAMP) taken 2008-2010
  from 24 sites on within 5 main Hawaiian Islands (Kauai, Oahu, Molokai, Maui, and
  Hawaii). Most sites consist of two transects along different isobaths, shallow (~2-4m)
  and deep (~7-13m) lines. A total of 67 transects were completed between May 2008
  - November 2010. Quantitative estimates of substrate type and species were acquired.
  The types and coverages were derived objectively from photographic images using
  PhotoGrid, a software package which analyzes random points on digital still images
  of coral reefs and substrate. This dataset does not include the images from the
  transects, which are accessioned within NOAA/NODC separately.\",\n\t\"license_title\":
